import React from "react";
import styled from "styled-components";
import './App.css';

class App extends React.Component {
  render() {
    return <div>
      <Container>
        <img className = "logo" alt = "logo" src= "image/logo.PNG"/>
        <p> Let's Start </p>
      </Container>
    </div>
  }
}

const Container = styled.div`
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  background: #000000;
  background-size: cover;
`;


export default App;
